@-moz-document url-prefix("https://web.roblox.com"), url-prefix("https://www.roblox.com")
{
/* This was heavily modified by DittoDino aka BoopBop, this is a form of credits to indicate who copied this code*/
  .ad, .ad *, .img_ad, .ad-annotations, #google_image_div, #aw0, #AdvertisingLeaderboard, .abp .UpsellAdButton, .abp .UpsellAdButton:link, .abp .UpsellAdButton:visited, .abp .BadAdButton, .abp .BadAdButton:link, .abp .BadAdButton:visited, .abp .ad-identification-text, a.ad img, .abp, .profile-ad
  {
    display: none !important;
    visibility: collapse;
  }
  /*Ad removal from 33kk's code  */
 
  #header
  {
    background-color: #5e5142;
  }

  .navigation .notification-icon, .rbx-highlight
  {
    background: #5e5142;
  }

  #chat-header
  {
    background: #5e5142;
      /*Party header*/
    ;
  }

  .slide-item-container-left, .profile-avatar-right
  {
    background: #5e5142;
  }

  .rbx-tabs-horizontal .rbx-tab.active .rbx-tab-heading, .rbx-tabs-horizontal .rbx-tab-heading:hover, .rbx-tabs-horizontal .rbx-tab-heading:focus, .rbx-tabs-horizontal .rbx-tab-heading:active
  {
    box-shadow: 0 -4px 0 #5e5142 inset;
  }

  .forum-table-header, body .forum-table-header th, body .forum-table-footer, #ctl00_cphRoblox_Message1_ctl00_CenterColumn > table > tbody > tr:nth-child(1) > th, #ctl00_cphRoblox_CenterColumn > table > tbody > tr:nth-child(1) > th
  {
    background: #961f15 !important;
      /*Forum colors and messaging underline color*/
    ;
  }

  .rbx-upgrade-now #upgrade-now-button, .rbx-btn-secondary-xs.btn-more, #AjaxCommentsContainer > div > div.comment-form > form > button, .rbx-vip-server-create, .btn-secondary-xs
  {
    background-color: #5e5142 !important;
    border-color: #ECEBEC;
      /*Updrade button*/
    ;
  }

  .rbx-upgrade-now #upgrade-now-button:hover, .rbx-btn-secondary-xs.btn-more:hover, #AjaxCommentsContainer > div > div.comment-form > form > button:hover, .rbx-vip-server-create:hover, .btn-secondary-xs:hover
  {
    background: #5e5142 !important;
    border-color: #FFF;
  }

  #TopAbpContainer, .ad-annotations, #LeftGutterAdContainer, #RightGutterAdContainer, #Skyscraper-Adp-Right, #Skyscraper-Adp-Left, .abp-spacer, #GamesListContainer1 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-even, #GamesListContainer1 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-odd, #GamesListContainer8 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-even, #GamesListContainer8 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-odd, .sponsored-game, .alert-info, #mCSB_1_container > ul > li.font-bold.small, #mCSB_1_container > ul > li.rbx-nav-sponsor /* This was heavily modified by DittoDino aka BoopBop, this is a form of credits to indicate who copied this code*/
  {
    display: none !important;
  }

  #navbar-search-input, #navbar-search-btn
  {
    border: 1px solid #5e5142;
      /*Search border color*/
    ;
  }

  body
  {
    background: transparent !important;
  }

  .content
  {
    background: transparent !important;
  }
  .container-footer
  {
	position:static;  
  }
  html
  {
    width: 100% !important;
    height: 100% !important;
    /*background-image: url(https://w0.peakpx.com/wallpaper/466/755/HD-wallpaper-xiao-zhongli-genshin-impact.jpg) !important;*/
      /* Background */
    background-size: cover !important;
    background-attachment: fixed !important;
	background-image: url("data:image/jpeg;base64,") ;
  }

  #party_none_title, div.friend_dock_chatbox_titlebar.chat-header-blink-off
  {
    background: linear-gradient(to bottom, #B787EA, #B787EA);
  }

  #ctl00_cphRoblox_RightColumn, #Body > table > tbody > tr > td:nth-child(3), #Body > table > tbody > tr > td:nth-child(4)
  {
    display: none;
  }

  #GamesPageLeftColumn
  {
    width: auto;
    margin-right: 10px !important;
    margin-left: 10px !important;
  }

  #GamesListsContainer > div
  {
    background-color: transparent !important;
    width: 100% !important;
  }

  #navigation
  {
    background-color: #5e5142;
  }

  .rbx-btn-primary-lg
  {
    background-color: #5e5142;
  }

  .rbx-btn-primary-lg:hover, .rbx-btn-primary-lg:focus
  {
    background-color: #5e5142;
  }

  .avatar-back
  {
    background-image: url(https://w0.peakpx.com/wallpaper/466/755/HD-wallpaper-xiao-zhongli-genshin-impact.jpg);
  }
}
